css:
.isearch .find-container {
  display: -webkit-flex;
  -webkit-flex-direction: row;
}
.isearch .find-container .btn-group {
  margin-left: 10px;
}
.isearch .find-container .editor-container {
  position: relative;
  -webkit-flex: 1;
}
.isearch .find-container .editor-container .editor {
  width: 100%;
}
.editor .isearch-result .region {
  background-color: transparent;
  border-radius: 2px;
  border: 1px solid #444444;
}
.editor .isearch-current .region {
  background-color: transparent;
  border-radius: 2px;
  border: 1px solid #000000;
}
